import React from 'react';
import { NavLink } from 'react-router-dom';
import './checkRegister.css'

const CheckRegister = () => {
    return (
        <div>
            Se registro correctament
            <p>saduasdyhi</p>
            <button className='button'><NavLink to='/login'>Iniciar</NavLink></button>
        </div>
    );
};

export default CheckRegister;
